import logo from './logo.svg';
import './App.css';
import {Routes,Route} from 'react-router-dom'
import Login from './component/Login';
import Signup from './component/signup';
import Loginsuccessfully from './component/Loginsuccessfully';
import Signupsuccessfully from './component/Signupsuccessfully';
import {AuthProvider} from './component/auth';
import Navbar from './component/Navbar';
function App() {
  return (
    <div className="App">
     <AuthProvider>

        <Navbar/>

          <Routes>
            <Route path="/login" element={<Login/>}/>
            <Route path="/signup" element={<Signup/>}/>
            <Route path="/Loginsuccessfully" element={<Loginsuccessfully/>}/>
            <Route path="/Signupsuccessfully" element={<Signupsuccessfully/>}/>

          </Routes>

      </AuthProvider>
    </div>
  );
}

export default App;
